int Partion(int* arr, int left, int right)
{
	int begin = left;
	int end = right - 1;
	int key = arr[end];
	/*while (begin < end)
	{
	while (begin < end && arr[begin] <= key)
	{
	begin++;
	}

	while (begin < end && arr[end] > key)
	{
	end--;
	}

	if (begin < end)
	{
	int tmp = arr[begin];
	arr[begin++] = arr[end];
	arr[end--] = tmp;
	}
	}
	if (begin != right - 1)
	{
	arr[right - 1] = arr[begin];
	arr[begin] = key;
	}*/

	while (begin < end)
	{
		//end位置形成了一个新的坑
		// 让begin从前往后找比基准值大的元素
		while (begin < end && arr[begin] <= key)
			begin++;
		// 让begin位置大的元素填end位置的坑
		if (begin < end)
			arr[end--] = arr[begin];

		//begin位置形成了一个新的坑
		// 让end从后往前找比基准值小的元素，填begin位置的坑
		// 让end从后往前找，找比基准值小的元素，找到了就停下来
		while (begin < end && arr[end] >= key)
			end--;
		if (begin < end)
			arr[begin++] = arr[end];
	}
	//用基准值填最后的一个坑
	if (begin != right - 1)
		arr[begin] = key;

	return begin;
}


void QuickSort(int* arr, int left, int right)
{

	if (left >= right)
	{
		return;
	}
	int div = Partion(arr, left, right);
	QuickSort(arr, left, div);
	QuickSort(arr, div + 1, right);
}



int distributeCandies(int* candies, int candiesSize)
{
	int i = 0;
	int count = 1;
	if (candiesSize == 0 || candiesSize == 2)
		return candiesSize / 2;
	QuickSort(candies, 0, candiesSize);
	for (i = 0; i < candiesSize - 1; i++)
	{
		if (candies[i] != candies[i + 1])
		{
			count++;
		}
	}
	return candiesSize / 2<count ? candiesSize / 2 : count;
}

